import React from 'react'
import styles from '../styles/skills.scss'
import cardcontainer from './cardContainer'

const Skills = () => {
    return (
        <div className={styles.Main}>
            <cardcontainer/>
            <cardcontainer/>
            <cardcontainer/>
            
        </div>
    )
}

export default Skills
